export const CRYPTO = [
    {
        id: 1,
        title: 'Crypto Tracker',
        img: 'assets/crypto.png',
        des: 'In this project I utilized stateful logic, implemented two custom built hooks, and used mocks and spies in testing. I was able to build a custom hook that allowed me to save data to local storage, and another hook that set the dark-mode class on the body element. I was able to successfully compose the two hooks together to ensure data persists on this dark mode preference in my app.'
    }
]

export const TVSHOW = [
    {
        id: 2,
        title: 'TV Show Selector',
        img: 'assets/TV.png',
        des: 'I was asked to write tests for this web application to ensure that the feature I was working on displays all requested data properly. The feature was to fetch data from the API and display it to the page. I evaluated where state was being managed, where the async call was, and where different pieces of data were being rendered. Then wrote tests for both the App.js component and the Episodes.js component. All tests successfully passed!'
    }
]

export const Plants = [
    {
        id: 3,
        title: 'React Plants Ecommerce',
        img: 'assets/plants.png',
        des: 'During this project I was able to add class components to a basic ecommerce site that would allow me to request product from a server and render that data. I was also able to implement the ability to add items to a shopping cart. '
    }
]

export const Bubble = [
    {
        id: 4,
        title: 'Bubble Color Picker',
        img: 'assets/ColorPicker.png'
    }
]
